import React from "react";
import Github from "../../../../public/Icons/github.png";
const PortfolioContent = ({ pData }) => {
  const { name, image, links } = pData;
  return (
    <div>
      <div>
        <img src={image} />
      </div>
      <div>
        <a href={links}>
          <img src={Github} />
        </a>
      </div>
      <div>
        <p>{name}</p>
      </div>
    </div>
  );
};

export default PortfolioContent;
